pragma solidity ^0.5.0;


contract DVideo {
    string public myString = "Hello World";
    address payable public owner; //make payable?
    uint public videoCount;
    string public videoName;
    bool public paused;
    bool private initialized;

    modifier onlyOwner() {
        require(msg.sender == owner, "onlyOwner");
        _;
    }

    //Events
    event LogPauseContract(bool contractIsPaused);

    //Contract Constructor
    constructor() public {
        initialize();
        pause();
    }

    function initialize() public {
        require(!initialized, "already initialized");
        owner = msg.sender;
        videoCount = 0;
        videoName = "DVideo";
        // lawEnforcementRole = address(0);
        // totalSupply_ = 0;
        // supplyController = msg.sender;
        // initialized = true;
    }

    function pause() public onlyOwner {
        require(!paused, "already paused");
        paused = true;
        emit LogPauseContract(true);
    }

    function uploadVideo(string memory _videoHash, string memory _title) public {

    }

    //what does "memory" do? Must be together with string?
    function set(string memory x) public {
        myString = x;
    }

    function get() public view returns (string memory stringValue) {
        return myString;
    }
}
